import React from 'react';
import { TextField, FormControl, Input, InputLabel } from '@mui/material';
const Contact = () => {
  return (
    <div className=" content bg-color " id="contact">
      <h1>Contact</h1>

      <form noValidate autoComplete="off">
        <TextField id="standard-basic" label="Standard" focused />
        <TextField id="filled-basic" label="Filled" variant="filled" focused />
        <TextField id="outlined-basic" label="Outlined" variant="outlined" />
        <TextField
          required
          id="standard-required"
          defaultValue="Hello World"
          variant="filled"
        />
      </form>
    </div>
  );
};

export default Contact;
